import Mix from "../Mix";

const MixContainer = ({ stations }) => (
  <section className="flex flex-wrap justify-center">
    {stations.map((mixes) => (
        <div className="outline w-25 pa3 mr2 mb2">
          <img src={mixes.pictures.large} className="w-100"/>
          <p>{mixes.name}</p>
          <p>{mixes.name}</p>
        </div>
    ))}
  </section>
);

export default MixContainer;
